import "./Blogs.css";
import { useState, useEffect } from "react";

export const Blogs = () => {
  const [blogs, setBlogs] = useState(null);
  useEffect(async () => {
    let result = await fetch("http://localhost:5002/api/posts/allposts");
    result = await result.json();
    setBlogs(result);
    console.log(result);
  }, []);

  return (
    <div className="Blogs">
      blogs.map((index)=>(
      <Post title="hello world" />
      ))
    </div>
  );
};
